import logo from "./images/netflix-Logo.svg";
import React from "react";
import HeaderCss from "./header.module.css";

function Header() {
  return (
    <>
      <div>
        <nav>
        <img src="https://assets.nflxext.com/ffe/siteui/vlv3/6e32b96a-d4be-4e44-a19b-1bd2d2279b51/ee068656-14b9-4821-89b4-53b4937d9f1c/IN-en-20220516-popsignuptwoweeks-perspective_alpha_website_small.jpg"  alt=""></img>
          <img className={HeaderCss.nav_logo} src={logo} alt="Netflix Logo" />
                 
        </nav>
      </div>
    </>
  );
}

export default Header;
